-- ----------------------------
-- Procedure structure for laba_berjalan
-- ----------------------------
DROP PROCEDURE IF EXISTS `laba_berjalan`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `laba_berjalan`( IN  period_from date, period_to date )
BEGIN
set @income1 = ( SELECT
									COALESCE( SUM(balance),0 ) 
								FROM
									closed_balance
								WHERE
									date BETWEEN period_from AND period_to
									AND LEFT ( coa_id, 1 ) = 5 );
									
set @income2 = ( SELECT
									COALESCE( SUM(balance),0 ) 
								FROM
									closed_balance
								WHERE
									date BETWEEN period_from AND period_to
									AND LEFT ( coa_reff_id, 3 ) = 801  );  -- other income
							
set @expense1 = ( SELECT
									COALESCE( SUM(balance),0 ) 
								FROM
									closed_balance
								WHERE
									date BETWEEN period_from AND period_to
									AND LEFT ( coa_id, 1 ) IN (6,7,9) );
									
set @expense2 = ( SELECT
									COALESCE( SUM(balance),0 ) 
								FROM
									closed_balance
								WHERE
									date BETWEEN period_from AND period_to
									AND LEFT ( coa_reff_id, 3 ) = 802 ); -- other expense
									
SELECT (@income1 + @income2) - (@expense1 + @expense2) as lababerjalan;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for laba_ditahan
-- ----------------------------
DROP PROCEDURE IF EXISTS `laba_ditahan`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `laba_ditahan`( IN  period date )
BEGIN
set @income1 = ( SELECT
									COALESCE( SUM(balance),0 ) 
								FROM
									closed_balance
								WHERE
									date <= period
									AND LEFT ( coa_id, 1 ) = 5  );
									
set @income2 = ( SELECT
									COALESCE( SUM(balance),0 ) 
								FROM
									closed_balance
								WHERE
									date <= period
									AND LEFT ( coa_reff_id, 3 ) = 801  );  -- other income
							
set @expense1 = ( SELECT
									COALESCE( SUM(balance),0 ) 
								FROM
									closed_balance
								WHERE
									date <= period
									AND LEFT ( coa_id, 1 ) IN (6,7,9) );
									
set @expense2 = ( SELECT
									COALESCE( SUM(balance),0 ) 
								FROM
									closed_balance
								WHERE
									date <= period
									AND LEFT ( coa_reff_id, 3 ) = 802 ); -- other expense
									
SELECT (@income1 + @income2) - (@expense1 + @expense2) as labaditahan;

END
;;
delimiter ;

